import React from "react";
import "./index.css";
import { Link } from "react-router-dom";

const Skills = () => {
  return (
    <>
      <Link to="">
      <i className="fa-regular fa-pen-to-square mx-2"></i>
      </Link>
    </>
  );
};

export default Skills;
